import ChallengeScroll from "./ChallengeScroll";

const WeeklyChallenge = () => {

    return (
            <div id = "WeeklyChallenge">
              <div>
                <h2>Global Challenges</h2>
              </div>

              <ChallengeScroll type = "weekly"></ChallengeScroll>
            </div>

          );
}

export default WeeklyChallenge;
